import React from 'react'
import Box from '@mui/material/Box';
import Typography from '@mui/material/Typography'

function NotFound() {
  return (
    <Box>
        <Typography variant="h2" ></Typography>
        NotFound
        </Box>
  )
}

export default NotFound
